import React from 'react';
import { NavLink } from "react-router-dom";

export const Header = () => {
  return(
    <div className="header">
      <NavLink exact to='/' className="header-link">Variant 1</NavLink>
      <NavLink to='/variant_2' className="header-link">Variant 2</NavLink>
      <NavLink to='/variant_3' className="header-link">Variant 3</NavLink>
    </div>
  )
};
